#include <string>
#include <vector>
#include <cstdio>
#include <cstring>
#include <cstdlib>
#include <cmath>
#include <iostream>
#include <sstream>
#include <algorithm>
#include <utility>
 
using namespace std;
 
class StrangeCountry {
  public:
  
  int flag[100];
  int n, m;
  vector<string> g;
  
  void dfs(int x) {
    if (flag[x]) return;
    flag[x] = 1;
    m++;
    int i;
    for (i = 0; i < n; i++) {
      if (g[x][i] == 'Y') {
        dfs(i);
      }
    }
  }
  
  int transform(vector <string> gg) {
    int i, j, k = 0, t = 0;
    g = gg;
    n = g.size();
    for (i = 0; i < n; i++) {
      for (j = 0; j < n; j++) if (g[i][j] == 'Y') {
        k++;
      }
    }
    k /= 2;
    if (k < n - 1) return -1;
    for (i = 0; i < n; i++) if (!flag[i]) {
      m = 0;
      dfs(i);
      if (m == 1) return -1;
      t++;
    }
    return t - 1;
  }
};
 
 
